.uk-grid-divider { margin-left: -($grid-gutter-horizontal * 2); }
.uk-grid-divider > * { padding-left: ($grid-gutter-horizontal * 2); }

.uk-grid-divider > :not(.uk-first-column)::before { left: $grid-gutter-horizontal; }

